        /// <summary>
        /// 添加战斗中使用到的功法
        /// </summary>
        /// <param name="isActor"></param>
        /// <param name="gongFaId"></param>
        public void AddUseGongfa(bool isActor, int gongFaId)
        {
            if (gongFaId / 10000 > 15)
                return;
            if (isActor)
            {
                if (GongfaProficiency.ContainsKey(gongFaId))
                    GongfaProficiency[gongFaId]++;
                else
                    GongfaProficiency.Add(gongFaId, 1);
                actorUseGongfaTimes++;
            }
            else
            {
                System.Reflection.FieldInfo m_mianEnemyId = typeof(BattleSystem).GetField("mianEnemyId", System.Reflection.BindingFlags.NonPublic | System.Reflection.BindingFlags.Instance);
                int mainEnemyId = (int)m_mianEnemyId.GetValue(BattleSystem.instance); // 获得敌人id
                var gongFas = DateFile.instance.actorGongFas[mainEnemyId];
                if (!gongFas.ContainsKey(gongFaId))
                    return;
                var gongFaData = gongFas[gongFaId];// [0]修习程度  [1]npc独有心法等级  [2]逆练页数
                int playerLevel = 0;
                if (DateFile.instance.gongFaBookPages.ContainsKey(gongFaId))
                {
                    var pages = DateFile.instance.gongFaBookPages[gongFaId];
                    for (int i = 0; i < pages.Length; i++)
                    {
                        if (pages[i] == 1)
                            playerLevel++;
                        else
                            break;
                    }
                }
                // Main.Logger.Log("敌人功法 " + DateFile.instance.gongFaDate[gongFaId][0] + " " + gongFaData[0] + " " + gongFaData[1] + " " + gongFaData[2] + " 玩家等级" + playerLevel);

                if (playerLevel < gongFaData[1])
                {
                    int isNiLian = Random.Range(0, gongFaData[1]) < gongFaData[2] ? 1 : 0; // 判断领悟到的功法是正练还是逆练
                    // Main.Logger.Log("记录一个功法使用记录：" + (isNiLian == 1 ? "逆" : "正"));
                    if (!BattleGongfaWeitht.ContainsKey(gongFaId))
                        BattleGongfaWeitht.Add(gongFaId, new int[2]);

                    if (BattleGongfaWeitht[gongFaId][isNiLian] == 1)
                        BattleGongfaWeitht[gongFaId][isNiLian] = 4;
                    else
                        BattleGongfaWeitht[gongFaId][isNiLian] += 2;
                    enemyUseGongfaTimes++;
                }
            }
        }

